import React from "react";


export default class Basdepage extends React.Component{
    render(){ (
    <article class="basdepage_container">
        <h1>Contactez-nous</h1>
        <h2></h2>
        <article class="reseaux_sociaux_logo_container">
            <img class="logo_reseau" src="logo_insta.png" alt="log insta"/>
            <img class="logo_reseau" src="logo_facebook.png" alt="log fb"/>
            <img class="logo_reseau" src="logo_linkedin.png" alt="log linkedin"/>
        </article>
    </article>
    
    );
    
    }
}
